import React from "react";
import './header.css'


function Header() {
  return (
    <div className="header">
      <ul>
        <li><a>Home </a></li>
        <li><a>Login </a></li>
        <li><a>Register </a></li>
        <li><a>Portfolio </a></li>
      </ul>

    </div>
  );
}

export default Header;
